CREATE SENSOR StationObservation (interval: 300, geometry: Point) WITH PROPERTIES (code String, name String, description String) WITH MEASUREMENT DATA (vibration Double UNITS 'db', min_ultrasound_bound_time Double UNITS 'Hz', max_ultrasound_bound_time Double UNITS 'Hz', min_microwave_bound_time Double UNITS 'Hz', max_microwave_bound_time Double UNITS 'Hz', movement_detected Boolean) WITH SPATIAL GROUP Floor (Floor) WITH BBOX ([42.7, -8.1], 9);

CREATE PRODUCT structure_deformation USING 4326; 
CREATE SPATIAL DIMENSION Municipality (geometry: Polygon) WITH PROPERTIES (shortName String, name String, code String); 
CREATE SENSOR StationObservation (interval: 1500, geometry: Point) WITH PROPERTIES (code String, name String, type String) WITH MEASUREMENT DATA (incline Double UNITS 'º', displacement Double UNITS 'mm', deformation Double UNITS '%') WITH SPATIAL GROUP Municipality (Municipality) WITH BBOX ([42.7, -8.1], 9);

CREATE PRODUCT toxic_elements USING 4326; 
CREATE SPATIAL DIMENSION Building (geometry: Polygon) WITH PROPERTIES (shortName String, name String, type String, area Double, constructionDate DateTime); 
CREATE SENSOR StationObservation (interval: 1500, geometry: Point) WITH PROPERTIES (description String, name String) WITH MEASUREMENT DATA (co Double, co2 Double, so2 Double, nox Double, o3 Double, nh3 Double, h2 Double, rn Double) WITH SPATIAL GROUP Buildings (Building) WITH BBOX ([42.7, -8.1], 9);

CREATE PRODUCT ships USING 4326; 
CREATE SPATIAL DIMENSION Ocean (geometry: Polygon) WITH PROPERTIES (shortName String, name String); 
CREATE SENSOR StationObservation (interval: 300, geometry: Point) WITH PROPERTIES (description String, name String, country String) WITH MEASUREMENT DATA (temperature Double UNITS 'ºC' ICON 'thermometer-low', salinity Double UNITS 'PSU', pressure Double UNITS 'dbar' ICON 'speedometer') WITH SPATIAL GROUP OceanGroup (Ocean) WITH BBOX ([42.7, -8.1], 9);

CREATE SPATIAL DIMENSION Municipality (geometry: Polygon) WITH PROPERTIES (cMun Integer); 
CREATE SPATIAL DIMENSION District (geometry: Polygon) WITH PROPERTIES (cDis Integer) WITH PARENT (Municipality); 
CREATE SPATIAL DIMENSION Section (geometry: Polygon) WITH PROPERTIES (cSec Integer) WITH PARENT (District);

CREATE SENSOR StationObservation (interval: 10, geometry: Polygon) WITH PROPERTIES (name String) WITH MEASUREMENT DATA (value Double, quality Integer) WITH SPATIAL GROUP ZoneDimension (ZoneDimension) WITH CATEGORICAL GROUP SensorType; 

Note: The creation of the spatial dimension ZoneDimension and the categorical dimension SensorType should be done previously with the following sentences:

CREATE SPATIAL DIMENSION ZoneDimension (geometry: Polygon) WITH PROPERTIES (name String);
CREATE CATEGORICAL DIMENSION SensorType;

CREATE CATEGORICAL DIMENSION SimpleGrade (FIELD: grade);
CREATE RANGE GradeRange (
  0 TO 4.99 AS 'failed',
  5 TO 10 AS 'approved'
);

CREATE SENSOR StationObservation (interval: 900, geometry: Point) WITH PROPERTIES (code String, name String, description String, material String, date DateTime) WITH MEASUREMENT DATA (water_flow Double, water_preassure Double) WITH SPATIAL GROUP Urban (City) WITH BBOX ([42.7, -8.1], 9); 

Note: The spatial dimension "City" should be previously created with the following command:
CREATE SPATIAL DIMENSION City (geometry: Polygon) WITH PROPERTIES (name String);

