CREATE CATEGORICAL DIMENSION Depth (field: depth); 
CREATE RANGE DepthRange (0 TO 3 AS 'surface', 4.75 TO 5.25 AS '5m', 9.75 TO 10.25 AS '10m', 14.75 TO 15.25 AS '15m', 19.75 TO 20.25 AS '20m'); 
CREATE CATEGORICAL DIMENSION alarm (field: alarm); 
CREATE SENSOR StationObservation (interval: 300, geometry: Point) WITH PROPERTIES (maxDepth Float, code String, name String, description String, startTime DateTime, endTime DateTime) 
WITH MEASUREMENT DATA (temperature_ITS90 Double UNITS 'ºC' ICON 'thermometer-low', salinity Double UNITS 'PSU', pressure Double UNITS 'dbar' ICON 'speedometer', ph Double UNITS 'pH' ICON 'ph', oxygen Double UNITS 'mg/l' ICON 'gas-cylinder', transmittance Double UNITS 'm', irradiance Double UNITS 'W/m2', uv_flourescence Double UNITS 'mg/m3', density Double UNITS 'kg/m3', conductivity Double UNITS 'S/m') 
WITH SPATIAL GROUP Estuary (Estuary) WITH CATEGORICAL GROUP Depth (Depth RANGE DepthRange) WITH CATEGORICAL GROUP alarm (alarm) WITH BBOX ([42.7, -8.1], 9);

